INSERT INTO messages (id, conversation_id, jeju_text, translated_text, timestamp) VALUES ('21', '8', '모르쿠다. 요새 왕이 아판.', '모르겠어요. 요즘 왕이 아파요.', '18:34');
INSERT INTO messages (id, conversation_id, jeju_text, translated_text, timestamp) VALUES ('22', '8', '어디가 아프시다고요. 잠시만 이거 빼야겠다. 뼈가 아니야.', '어디가 아프시다고요. 잠시만 이거 빼야겠네요. 꽝(뼈)가 아니에요.', '18:34');
