INSERT INTO messages (id, conversation_id, jeju_text, translated_text, timestamp) VALUES ('40', '10', '성우 님 잘 지네고 계시는지 확인차 연락드렸어요. 저 지난번에 방문했던 사회복지사예요. 어디 아픈 데는 없으시죠?', '제잘', '18:38');
